import React from 'react';
import { 
  AppBar, 
  Toolbar, 
  Typography, 
  FormControl,
  Select,
  MenuItem,
  Box,
  ToggleButton,
  ToggleButtonGroup
} from '@mui/material';

function NavBar({ years, selectedYear, onYearSelect, successFilter, onSuccessFilterChange }) {
  return (
    <AppBar position="static" sx={{ 
      background: 'rgba(26, 44, 78, 0.8)',
      backdropFilter: 'blur(10px)'
    }}>
      <Toolbar>
        <Box sx={{ 
          display: 'flex', 
          alignItems: 'center', 
          flexGrow: 1 
        }}>
          <Typography
            variant="h6"
            sx={{
              background: 'linear-gradient(45deg, #00f5ff 30%, #7b1fa2 90%)',
              WebkitBackgroundClip: 'text',
              WebkitTextFillColor: 'transparent',
              fontWeight: 'bold',
              fontSize: '1.5rem',
              mr: 2
            }}
          >
            SpaceX Launch Dashboard
          </Typography>
        </Box>

        <Box sx={{ display: 'flex', gap: 2, alignItems: 'center' }}>
          <ToggleButtonGroup
            value={successFilter}
            exclusive
            onChange={(e, value) => onSuccessFilterChange(value)}
            size="small"
            sx={{
              '& .MuiToggleButton-root': {
                color: 'white',
                borderColor: 'rgba(255, 255, 255, 0.23)',
                '&.Mui-selected': {
                  backgroundColor: 'rgba(0, 245, 255, 0.2)',
                  color: '#00f5ff'
                }
              }
            }}
          >
            <ToggleButton value="all">
              All
            </ToggleButton>
            <ToggleButton value="success">
              Success Only
            </ToggleButton>
          </ToggleButtonGroup>

          <FormControl 
            variant="outlined" 
            size="small"
            sx={{ 
              minWidth: 120,
              '& .MuiOutlinedInput-root': {
                color: 'white',
                '& fieldset': {
                  borderColor: 'rgba(255, 255, 255, 0.23)'
                },
                '&:hover fieldset': {
                  borderColor: 'rgba(255, 255, 255, 0.5)'
                }
              }
            }}
          >
          <Select
            value={selectedYear || ''}
            onChange={(e) => onYearSelect(e.target.value || null)}
            displayEmpty
          >
            <MenuItem value="">
              <em>All Years</em>
            </MenuItem>
            {years.map((year) => (
              <MenuItem key={year} value={year}>
                {year}
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default NavBar;
